        <div>
            {props.map((val,idx)=>{
                return(
                    <div>
                        <h4>dish: <strong>{val.Dish_Name}</strong>   ||  qty: <strong>{val.quantity}</strong>   ||    price: <strong>{val.Dish_Price}</strong></h4>
                    </div>
                )

            })}
            
        </div>
    )
}

export default Checkout
